import axios from "axios";
import { useSelector } from "react-redux";
import { useParams } from "react-router-dom";

function EditForm() {
    const params = useParams()
    const fechingData = async () => {
        const res = await axios.get(`http://localhost:5000/contact/${params.id}`)
        console.log(res.data);
    }

    return <form className="w-50 p-3">
        <div className="mb-3">
            <label htmlFor="ID" className="form-label">ID</label>
            <input type="number" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" />
        </div>
        <div className="mb-3">
            <label htmlFor="name" className="form-label">Name</label>
            <input type="text" className="form-control" id="exampleInputPassword1" />
        </div>
        <div className="mb-3">
            <label htmlFor="email" className="form-label">Email</label>
            <input type="text" className="form-control" id="exampleInputPassword1" />
        </div>
        <div className="mb-3">
            <label htmlFor="addres" className="form-label">Addres</label>
            <input type="text" className="form-control" id="exampleInputPassword1" />
        </div>

        <button type="button" className="btn btn-info">Submit</button>
    </form>
}
export default EditForm
